    region: 'us-east-1',
    accessKeyId: 'AKIA5JIEG6VWZTGLWFNO',
    secretAccessKey: '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',
}

function App() {
  return (
    <div className="App">
     <input
      type='file'
      onChange={(e)=>{
        React.upload(e.target.files[0], config).then(()=>{
          console.log('test', e.target.files[0]);
        })

      }}
     />
    </div>
  );
}

